import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div className='wrap-header'>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>

    <style jsx>{
        `
        .wrap-header {
            height: 50px;
            width: 100%;
            display: flex;
            align-items: center;
            padding: 10px;
            background-color: lightgreen;
        }

        .wrap-header a {
            text-decoration: none;
            font-size: 20px;
            font-family: Arial;
        }
        `
        }</style>
  </div>

);

export default Header;
